QUETTA, Jan 22 (APP):Special Assistant to the Prime Minister for Information and Broadcasting Dr. Firdous Ashiq Awan arrived here two day-visit on Wednesday.
Dr Firdous Ashiq Awan was received at Quetta Airport by Deputy Speaker Balochistan Assembly Sardar Babar Khan Musakhail, member of provincial Assembly (MPA) Mubeen Khan Khilji, Balochistan Government’s Spokesman Liaqat Shahwani, Pakistan Tehreek-e-Insaf (PTI)’s Provincial Leader Sardar Yar Muhammad Rind’s son Sardar Khan Rind and Babar Yousafzai and other political leaders.
